  false,\n\t\"url\": null,\n\t\"notes\": \"The Minnesota Cooperative Fish and Wildlife
  Research Unit (MCFWRU) became involved in research on the impacts of pesticides
  on wetland wildlife in 1990. This research is a continuation of work done in North
  Dakota during the late 1980's by the Patuxent Wildlife Research Center, U.S. Fish
  and Wildlife Service (USFWS). In this report we describe a field experiment conducted
  during 1990. This research was designed to evaluate the impact of the pesticide
  esfenvalerate on invertebrates after entering wetlands in the form of drift from
  aerial application to adjacent crop land.\",\n\t\"license_title\": \"License Not
